import React, { FunctionComponent } from 'react';
import { ParallaxProvider, Parallax } from 'react-scroll-parallax';

const Landing: FunctionComponent = () => {
    return (
        <ParallaxProvider>
            <Parallax y={[-20, 0]}>
                <img src="images/parallax-1.jpg" alt="test"/>   
            </Parallax>
        </ParallaxProvider>
    )
}

export default Landing;
